import './dist/main'



const Spinner = () => {
    return(
        <Fragment>
            <script src="dist/main.js" type="text/javascript">
<link href="dist/main.css" type="text/css" rel="stylesheet"/>
<script src="dist/main.js" type="text/javascript"></script>
</script>
<div class="lv-circles sm lvl-5" data-label="Loading..."></div>
        </Fragment>
        
    
    ) 
}

export default Spinner;
